$(document).ready((function(){$(".owl-carousel").owlCarousel({loop:!0,rtl:!0,margin:10,center:!0,dots:!1,nav:!0,navText:["<img src='./img/home/next.png'>","<img src='./img/home/prev.png'>"],responsive:{0:{items:1},600:{items:2},992:{items:3}}}),$(document).mouseup((function(e){if($(".popup").hasClass("active")){let t=$(".window-pop");t.is(e.target)||0!==t.has(e.target).length||$(".popup").removeClass("active")}})),$(".popUpBtn").click((function(){let e=$(this).data("pop");$(".pop_"+e).addClass("active")}))}));